%%
%--------------- Part 5: Drawing 'H' -----------------------

%----Given Values-------
d = 84 * 10^-6;     %Diameter of droplet (m)
r = 42 * 10^-6;     %Radius of droplet (m)
vx = 20;            %Velocity in x direction (m/s)
L1 = 0.5 * 10^-3;     %Length of Capacitor (m)
L2 = 1.25 * 10^-3;  %Distance between paper and cap (m)
D = 1.25 * 10^-3 + L1 + L2;  %Distance to paper (m)
q = -1.9*10^-10;    %Charge of electron (C)
pd = 1000;          %Density of droplet (kg/m^3)
W = 1 *10^-3;       %Diameter between Cap plates (m)

%------Equations------
m = pd * (4/3)*pi*(r)^3;  %Mass of droplet

%----Condition values----
dt = .000001;  %Time step
i = 1;
u = 1;
o = 1;

% Calculate max Voltage
CapTime = L1 / vx; % s
TimeToPaper = L2 / vx;

maxV = floor((W^2 * m) / (CapTime^2 * q)); % V

E = maxV / W;
ay = q*E/m;
vy = ay * CapTime;

peak = (ay * CapTime^2) + vy * TimeToPaper;


clear points
points(1) = peak;
while points(o) > -peak
    o = o + 1;
    points(o) = points(o-1) - d;
end

numDistPoints = floor((D/dt)/20);

clear V
for it = 1:length(points)
    V(it) = (m*points(it)*W*(vx)^2)/(q*L1*L2);
end

clear x
clear z
clear y
clear j
clear k
clear test

state1 = false;
state2 = false;
state3 = false;

for h = 1:3
    
    if (h == 1) % First Leg of H
        state1 = true;
        state2 = false;
        state3 = false;
    elseif h == 2
        state1 = false;
        state2 = true;
        state3 = false;
    elseif h == 3
        state1 = false;
        state2 = false;
        state3 = true;
    end
    
    for test = 1:length(points)
        
        if state1
            VolY = V(test);
            VolZ = V(1);
        elseif state2
            VolY = 0;
            VolZ = V(test);
        elseif state3
            VolY = V(test);
            VolZ = V(end);
        end
        EY = VolY / W;
        EZ = VolZ / W;
    
        %Reset indexes
        x(1) = 0;
        y(1) = 0;
        z(1) = 0;
    
        vy = 0;
        vz = 0;
    
        for i = 2:numDistPoints      %iterations in mm
            % Update index
    
            beforeCap = x(i-1) < (D-L1-L2);
            afterCap = x(i-1) > (D-L2);
    
            % Calculate new velocities
            if ~beforeCap && ~afterCap
                ay = q*EY/m;
                az = q*EZ/m;
                vy = vy + ay * dt;
                vz = vz + az * dt;
            else
                ay = 0;
                az = 0;
            end
    
            % Calculate new positions
    
            x(i) = x(i-1) + vx * dt;
            y(i) = y(i-1) + vy * dt + ay * dt^2;
            z(i) = z(i-1) + vz * dt + az * dt^2;
            j(test,i,h) = y(i);
            k(test,i,h) = z(i);
        
        end
    end
end

